    data: |
      SELECT DISTINCT col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col2 * col1 BETWEEN ( + col1 ) AND 92 - - col0 * col2;
  - name: tab1

outputs:
  - name: q6404.out
    data: |
      14
      47
      5
